INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 1, 0, 24001, "あたしだって\nやるときはやるよ！", 1, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 1, 1, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 1, 2, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 2, 3, 24004, "やったね！\nこれでようやく\nサボれるよ…", 2, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 1, 4, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 2, 5, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 2, 6, 24007, "あたしも意外と\nやるもんでしょ？", 2, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 4, 7, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 4, 8, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 4, 9, 24010, "まじめに\nやったんだけどな…\n悔しいな～", 4, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 4, 10, 24011, "やられた…\nねずみって意外と\nてごわいね", 4, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 4, 11, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, "リン", 0.0, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("2030/12/17 14:59:59", 10040, 1, 12, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", 4, "リン", 1.81, 0.0, 24, 0.0, "2020/04/30 12:00:00", 102601);
